import React from "react"
import {Button} from "./Button.component";

class ButtonContainer extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: ""
    }
  }

  increment = () => {
    this.setState({
      count: this.state.count + 1
    })
  }

  decrement = () => {
    this.setState({
      count: this.state.count - 1
    })
    console.log("vahid")
  }

  reset = () => {
    this.setState({
      count: 0
    })
  }

  render() {
    return <Button onIncrement={()=> this.increment()}/>
  }
}

export default ButtonContainer
